// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

contract SubscriptionContract {
    address public subscribedContract;
    mapping(address => bytes32) public userIds; // mapping the ether address to user id 
    mapping(address => bool) public subscriptions; //mapping the acc address 
    mapping(address => mapping(bytes32 => uint256[])) public eventInfo;

    constructor() {
        subscribedContract = msg.sender;
    }

    function setUserId(bytes32 _userId) public {
        userIds[msg.sender] = _userId;
    }

    function subscribe() public {
        subscriptions[msg.sender] = true;
    }

    function unsubscribe() public {
        subscriptions[msg.sender] = false;
    }

    function getEventInfo(bytes32 _eventName) public view returns (uint256[] memory) {
        require(subscriptions[msg.sender], "User is not subscribed.");
        return eventInfo[msg.sender][_eventName];
    }

    function updateEventInfo(bytes32 _eventName, uint256 _eventData) public {
        require(msg.sender == subscribedContract, "Only the subscribed contract can update event info.");
        for (uint i = 0; i < 2**160; i++) {
            address userAddr = address(uint160(i));
            if (subscriptions[userAddr]) {
                eventInfo[userAddr][_eventName].push(_eventData);
            }
        }
    }
}
